import NavBar from '../NavBar';
import Footer from '../Footer';
import BodySection from '../BodySection';

function Rescue(){
    return <div>
    <NavBar/>
    <img className="firstImage" src="https://images.pexels.com/photos/1805164/pexels-photo-1805164.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=1"/>
<BodySection
    header={'Rescue'}
    message={'We believe in a community based rescue approach. Working together we can make the world a better place for animals.'}

/>
<Footer/>
    </div> 
}

export default Rescue
